// src/pages/Navigation.js
import React, { useEffect, useRef } from 'react';
import { EventHandlingModule } from '../modules/EventHandlingModule';

export const Navigation = () => {
  const scrollRef = useRef(null);
  const progbarRef = useRef(null);

  useEffect(() => {
    const handleScroll = () => {
      if (progbarRef.current && scrollRef.current) {
        progbarRef.current.value = scrollRef.current.scrollTop;
        window.updateAgent?.();
      }
    };

    const handleInput = () => {
      window.updateAgent?.();
    };

    const scrollElement = scrollRef.current;
    const progbarElement = progbarRef.current;

    if (scrollElement && progbarElement) {
      scrollElement.addEventListener('scroll', handleScroll);
      progbarElement.addEventListener('input', handleInput);
    } else {
      console.warn('Scroll or Progress bar element not found');
    }

    // Cleanup event listeners on unmount
    return () => {
      if (scrollElement) {
        scrollElement.removeEventListener('scroll', handleScroll);
      }
      if (progbarElement) {
        progbarElement.removeEventListener('input', handleInput);
      }
    };
  }, []);

  return (
    <div className="container" style={{ padding: '1rem' }}>
      {/* Color Theme Selector */}
      <select name="Color Theme" id="theme-dropdown" style={{ marginBottom: '1rem' }}>
        <option value="light">Default</option>
        <option value="dark">Dark</option>
        <option value="secondary">Secondary</option>
        <option value="winter">Winter</option>
      </select>

      {/* Title Section */}
      <h1>
        <div id="title">
          <div
            style={{
              display: 'flex',
              flexWrap: 'wrap',
              alignItems: 'center',
              justifyContent: 'center',
              gap: '1rem',
            }}
          >
            <img
              id="titleicon"
              style={{ width: '100px', height: 'auto' }}
              src={process.env.PUBLIC_URL + '/hseapps.0051872e.png'}
              alt="HseAPPS Logo"
              width="40"
              height="40"
            />
            <span>HSE Maps</span>
          </div>
        </div>
      </h1>

      {/* Input Section */}
      <div id="inputdiv" style={{ marginBottom: '1rem' }}>
        <div
          style={{
            display: 'flex',
            flexWrap: 'wrap',
            justifyContent: 'center',
            gap: '1em',
            marginBottom: '1rem',
          }}
        >
          <input className="textbox" type="text" id="start" placeholder="Start" />
          <input className="textbox" type="text" id="end" placeholder="Destination" />
        </div>
        <button
          id="btn"
          onClick={() => window.markShortestPathFromInput()}
          style={{
            display: 'block',
            margin: '0 auto',
            padding: '0.5rem 1rem',
            cursor: 'pointer',
          }}
        >
          Route
        </button>
      </div>

      {/* SVG Map Section */}
      <div
        id="svgdiv"
        style={{
          position: 'relative',
          width: '100%',
          height: '500px',
          border: '1px solid #ccc',
          overflow: 'hidden',
          marginBottom: '1rem',
        }}
      >
        <div id="scroll" ref={scrollRef} style={{ width: '100%', height: '100%', overflow: 'auto' }}>
          <div style={{ height: '1000px' }}></div>
        </div>
        <svg
          id="svg"
          xmlns="http://www.w3.org/2000/svg"
          xmlnsXlink="http://www.w3.org/1999/xlink"
          version="1.1"
          viewBox="0 0 1308 2048"
          style={{ width: '100%', height: '100%' }}
        >
          <g>
            <g id="svgraph">
              <g>
                <image
                  id="map"
                  width="2048"
                  height="1308"
                  preserveAspectRatio="none"
                  xlinkHref={process.env.PUBLIC_URL + '/elements/mainfloorcrunched.png'}
                />
                <g id="graph"></g>
              </g>
            </g>
          </g>
        </svg>
      </div>

      {/* Progress Bar Section */}
      <div
        id="progbarcontainer"
        style={{
          margin: '1rem 0',
          display: 'flex',
          justifyContent: 'center',
        }}
      >
        <input
          title="Progress"
          type="range"
          min="0"
          max="200"
          defaultValue="0"
          id="progbar"
          ref={progbarRef}
          style={{ width: '80%' }}
        />
      </div>

      {/* Schedule Section */}
      <div
        id="schedulecontainer"
        style={{
          display: 'flex',
          justifyContent: 'center',
          gap: '1rem',
          marginTop: '1rem',
        }}
      >
        <input className="textbox" title="Schedule" type="text" id="sched" />
        <button
          id="btn"
          onClick={() => window.navSchedule()}
          style={{
            padding: '0.5rem 1rem',
            cursor: 'pointer',
          }}
        >
          Schedule
        </button>
      </div>
    </div>
  );
};
